<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>PDF</title>
    <style>
@import url('https://fonts.googleapis.com/css2?family=Roboto:wght@400;700&display=swap');
        @font-face {
        font-family: 'Open Sans';
        font-style: normal;
        font-weight: normal;
        src: url(http://themes.googleusercontent.com/static/fonts/opensans/v8/cJZKeOuBrn4kERxqtaUH3aCWcynf_cDxXwCLxiixG1c.ttf) format('truetype');
        }

        @page {
                margin: 0cm 0cm;
            }
            body {
                font-family: "Open Sans";
                color: #3d4762;
            }
            header {
                position: absolute;
                top: 0cm;
                left: 0cm;
                right: 0cm;
                bottom: 0cm;
                z-index: 1;
            }
            img{
                width: 100%;
                height: 100%;
            }
            main{
                position: relative;
                z-index: 2;
            }
            .--nombre{
                z-index: 2;
                position: absolute;
                top: 25%;
                left: 30%;
                font-size: 25px;
                font-family: "Open Sans";
            }
            .--dni{
                z-index: 2;
                position: absolute;
                top: 25%;
                left: 70%;
                font-size: 25px;
                font-family: "Open Sans";
            }
    </style>
</head>
<body>
    <header>
        <img src="data:image/png;base64,">
    </header>
    <main>
        <p class="--nombre">{{$nombre}}</p>
        <p class="--dni">{{$dni}}</p>
    </main>
</body>
</html>
